//Resend Script - Maxwell Rehbein 9/10/2019

var VerifyAndSave = function () {
    //This gets all of the form fields.
    VV.Form.ShowLoadingPanel();
    var formData = VV.Form.getFormDataCollection();

    //The following add any additional items to the form field collection.
    var formRevId = {};
    formRevId.name = 'REVISIONID';
    formRevId.value = VV.Form.DataID;
    formData.push(formRevId);


    //Following will prepare the collection and send with call to server side script.
    var data = JSON.stringify(formData);
    var requestObject = $.ajax({
        type: "POST",
        url: VV.BaseAppUrl + 'api/v1/' + VV.CustomerAlias + '/' + VV.CustomerDatabaseAlias + '/scripts?name=CommunicationLogSave',
        contentType: "application/json; charset=utf-8",
        data: data,
        success: '',
        error: ''
    });

    return requestObject;
};

var okfunction = function () {

}

var cancelfunction = function () {

}

var datesResent = VV.Form.GetFieldValue('Dates Resent');

var dateObj = new Date();

var resendNumber = VV.Form.GetFieldValue('Times Resent');
resendNumber++;

//Do an ajax save first so that a record is available to relate.
VerifyAndSave().then(function (resp) {
    VV.Form.HideLoadingPanel();
    var messageData = '';
    if (typeof (resp.status) != 'undefined') {
        messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the  web servers.  If this continues, please contact the administrator and communicate to them this message and where it occured.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (typeof (resp.statusCode) != 'undefined') {
        messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (resp.meta.status == '200') {
        if (resp.data[0] != 'undefined') {
            if (resp.data[0] == 'Success') {
                messageData = 'The record is saved when the yellow banner appears above.';
                VV.Form.SetFieldValue('Communication Sent', 'No');
                VV.Form.SetFieldValue('Times Resent', resendNumber);
                VV.Form.SetFieldValue('Dates Resent', (datesResent + ' ' + (dateObj.getMonth() + 1).toString() + '/' + dateObj.getDate().toString() + '/' + dateObj.getFullYear().toString()) + ', ');
                VV.Form.DoPostbackSave();
                VV.Form.Global.DisplayMessaging(messageData);
            }

            else if (resp.data[0] == 'Error') {
                messageData = 'An error was encountered while checking for the parent form. The error returned was ' + resp.data[1] + '.  The form will not save at this time.  Please try again or communicate this error to support.';
                VV.Form.Global.DisplayMessaging(messageData);
            }
            else {
                messageData = 'An unhandled response occurred from the unique record checking mechanism.  The form will not save at this time.  Please try again or communicate this issue to support.';
                VV.Form.Global.DisplayMessaging(messageData);
            }
        }
        else {
            messageData = 'The status of the response returned as undefined.';
            VV.Form.Global.DisplayMessaging(messageData);
        }
    }
    else {
        messageData = resp.data.error + '<br>';
        VV.Form.Global.DisplayMessaging(messageData);
    }
});

VV.Form.ShowLoadingPanel();

var formValidationResults = VV.Form.Template.FormValidation();
VV.Form.HideLoadingPanel();
if (formValidationResults == true) {
    VV.Form.DoPostbackSave();
}
else {
    alert('A red icon to the right of a field indicates it is required or the information entered is inaccurate. Hover your mouse over the red icon for further explanation. After correcting the issue and saving, the red icon will disappear.');
}

