//Do an ajax save first so that a record is available to relate.
VV.Form.DoAjaxFormSave().then(function () {
    VerifyAndSave().then(function (resp) {
        VV.Form.HideLoadingPanel();
        var messageData = '';
        if (typeof (resp.status) != 'undefined') {
            messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the  web servers.  If this continues, please contact the administrator and communicate to them this message and where it occured.";
            VV.Form.Global.DisplayMessaging(messageData);
        }
        else if (typeof (resp.statusCode) != 'undefined') {
            messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
            VV.Form.Global.DisplayMessaging(messageData);
        }
        else if (resp.meta.status == '200') {
            if (resp.data[0] != 'undefined') {
                if (resp.data[0] == 'Success') {
                    messageData = 'The record is saved when the yellow banner appears above.';
                    VV.Form.SetFieldValue('Form Saved', 'true');
                    VV.Form.DoPostbackSave();
                    VV.Form.Global.DisplayMessaging(messageData);
                }

                else if (resp.data[0] == 'Error') {
                    messageData = 'An error was encountered while checking for the parent form. The error returned was ' + resp.data[1] + '.  The form will not save at this time.  Please try again or communicate this error to support.';
                    VV.Form.Global.DisplayMessaging(messageData);
                }
                else {
                    messageData = 'An unhandled response occurred from the unique record checking mechanism.  The form will not save at this time.  Please try again or communicate this issue to support.';
                    VV.Form.Global.DisplayMessaging(messageData);
                }
            }
            else {
                messageData = 'The status of the response returned as undefined.';
                VV.Form.Global.DisplayMessaging(messageData);
            }
        }
        else {
            messageData = resp.data.error + '<br>';
            VV.Form.Global.DisplayMessaging(messageData);
        }
    })
});

var validationResult = VV.Form.Template.FormValidation();

if (validationResult) {
    VV.Form.Template.Resend();
}
else {
    var messageData = 'A red icon to the right of a field indicates it is required or the information entered is inaccurate. Hover your mouse over the red icon for further explanation. After correcting the issue and saving, the red icon will disappear.';
    VV.Form.Global.DisplayMessaging(messageData, 'Error');
}

VV.Form.Global.FormButtonStyle();

//Hide VV's close button:  
$("[class='CloseContainer']").hide();

//Change color of VV Form close buttons (1 for each close button):
$("[vvfieldname='btnClose']").css("background-color","#FF5252").css("color","#000").removeAttr('disabled').removeAttr('readonly');

VV.Form.Global.FormButtonStyle();

//Hide VV's close button:  
$("[class='CloseContainer']").hide();

//Change color of VV Form close buttons (1 for each close button):
$("[vvfieldname='btnClose']").css("background-color","#FF5252").css("color","#000").removeAttr('disabled').removeAttr('readonly');

var validationResult = VV.Form.Template.FormValidation();

if (validationResult) {
    VV.Form.Template.SaveCommLog();
}
else {
    var messageData = 'A red icon to the right of a field indicates it is required or the information entered is inaccurate. Hover your mouse over the red icon for further explanation. After correcting the issue and saving, the red icon will disappear.';
    VV.Form.Global.DisplayMessaging(messageData, 'Error');
}
